    const handleSubmit = async (e: React.MouseEvent<HTMLButtonElement>) => {
        e.preventDefault();

        try {
           localStorage.removeItem('token');
           setDummy(!dummy);
           console.log("clicky");
        }
        catch (error) {
            console.log(error);
        }
    }
    return (
        <div className="box">
            <div className="innerBox">
                <div className="basicText"></div>
                <input className="input" placeholder="Search..." />
